import Staff from "./containers/Staff/Staff";
import Movies from "./containers/Movies/Movies";
export const navMenu = [
    {
        id: '1',
        name: 'Tổng quan',
        route: '/total',
        Comp: Movies,
        role: ['staff', 'admin']
    },
    {
        id: '2',
        name: 'Quản lí',
        subMenu: [
            { id: '1', title: 'Xuất chiếu', route: '/manage/sub1', },
            { id: '2', title: 'Vé', route: '/manage/sub2', },
            { id: '3', title: 'Nhân viên', route: '/manage/sub3', },
        ], 
        Comp: Staff,
        role: ['admin']
    }
]
